message:
"Enquanto você viver, você estará sujeito a mudanças, quer você queira ou não - ora alegre, ora triste; ora satisfeito, ora descontente; ora devoto, ora não devoto; ora vigoroso, ora preguiçoso; ora sombrio, ora alegre.  . Mas um homem sábio que é bem instruído no trabalho espiritual permanece inabalável em todas essas coisas, e pouco se importa com o que sente, ou de que lado sopra o vento da instabilidade”.

 ~Thomas à Kempis

